    return(
        <div className='Posts'>
            {products.map( product => {
                //console.log(product)
                <ItemCard 
                    key={product.id}
                    img={product.img}
                    title={product.title}
                    //description={post.description}
                    price={post.price}
                    rating={product.rating}   
                />
            })}
        </div>
    )
}
